import React from "react";
import { FaTrash } from "react-icons/fa"; 

function TodoItem(props){
    
    return (
        <div>
            <li>
                {props.todoItem}
                <button onClick={() => props.onDelete(props.id)}>
                    <FaTrash style={{ padding: "0 5px 0" }}/>
                </button>
            </li>
        </div>
    )
}

export default TodoItem;
